import styled from "styled-components";
import img from "../../images/meme.jpg";

export const Back = styled.div`
  //height: 100vh;
  backgroundimage: ${{ img }};
  font-size: 48;
`;

export const Front = styled.h1`
  //

  font-family: "Oswald", sans-serif;
  font-weight: bold;
  color: #096192;
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
`;
